The use of positive affirmations are reported to decrease stress and advance academic or career support. 

Psychologists have found the benefits of speaking or writing affirmation is similar to those of exercising, but for your brain!

Positive affirmations have been shown to reduce negative thoughts, as they allow you to become more aware of your thought patterns and feelings. This, in turn, makes it harder for negative thoughts and feelings to take form or hold merit.

Expressing gratitude for the small things can improve your mood and your satisfaction with life.

Daily affirmations have been shown to be beneficial to physical health as well as emotional health. In fact, positive affirmations have been used in interventions that led people to increase their physical behavior, like exercise. 

All of the benefits of positive affirmations can contribute to an overall more positive mood which, studies have shown, leads to better cardiovascular health and reduces the risk of stroke, heart attacks, and other cardiac events. Daily positive affirmations also lessen the likelihood of dismissing health concerns and instead encourage you to respond with positive changes, like eating healthier or moving your body in a way that feels good to you.

